import React, { useEffect, useState } from 'react';
//import Shop from './pages/Shop';
//import { BrowserRouter, Routes, Route, Link } from "react-router-dom"; /api/search_product/2/

function App() {

  return (
    <div className="text-center text-3xl grid  grid-cols-3  justify-items-center justify-items items-center gap-4">


      <h1></h1>


      <div className=' bg-blue-600 w-28 rounded-md '>

        <Link to="/note">Note</Link> 

      </div>

      <div className=' bg-blue-600 w-28 rounded-md'>

        <Link to="/persona">Persona</Link>

      </div>

      <div className=' bg-blue-600 w-30 rounded-md'>

        <Link to="/persona">Prodotto</Link>

      </div>



    </div>
  );
}

export default App;
